window.bookSummaryJSON = "<p><b>Tap into the power of </b><b><i>The New Psycho-Cybernetics</i></b><b>.</b> </p> <p>Do you struggle daily to reach your goals, overcome obstacles, and eliminate pesky worries about your future? </p> <p>Most of us still live by the motto, “No pain, no gain.” But this approach to life is actually a prescription for fear, frustration, and self-doubt. </p> <p>Much of what we learn about success is based on the pain/gain idea: in essence, work harder, be more persistent, and develop greater willpower. <i>The New Psycho-Cybernetics</i> formula is anything but painful. It will allow you to achieve all your goals, faster, easier, and with less strain than you ever thought possible. </p> <p>Entrepreneurial genius Dan Kennedy has teamed up with Dr. Maxwell Maltz to create <i>The New Psycho-Cybernetics: A Mind Technology for Living Your Life without Limits</i>. Dr. Maltz’s principles of Psycho-Cybernetics have inspired and enhanced the lives of more than 30 million people around the world. Dr. Maltz invented a simple, step-by-step program that will help you replace a negative self-image with positive affirmations of empowerment. </p> <p><i>The New Psycho-Cybernetics</i> will help you: </p> <ul> <li>Deprogram yourself from self-doubt and negative self-evaluators. </li> <li>Respond to stressful events with positive, corrective action. </li> <li>Improve your self-image and reprogram yourself for success. </li> <li>Learn to recognize potential signs of danger and avoid failure. </li> <li>Overcome resistance to change. </li> <li>Cope with important responsibilities without feeling overwhelmed. </li> <li>Use a variety of techniques to virtually eliminate stress and anxiety from your life. </li> <li>Learn a 10-point program for daily self-image strength conditioning. </li> <li>And much more... </li> </ul> <p><b>PLEASE NOTE: When you purchase this title, the accompanying PDF will be available in your Audible Library along with the audio.</b></p>"; 
